  \"2015-10-08T07:41:48.921276\",\n\t\"name\": \"military-installations-ranges-and-training-areas\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This dataset, released by DoD, contains
  geographic information for major installations, ranges, and training areas in the
  United States and its territories.  This release integrates site information about
  DoD installations, training ranges, and land assets in a format which can be immediately
  put to work in commercial geospatial information systems.  Homeland Security/Homeland
  Defense, law enforcement, and readiness planners will benefit from immediate access
  to DoD site location data during emergencies.  Land use planning and renewable energy
  planning will also benefit from use of this data.  Users are advised that the point
  and boundary location datasets are intended for planning purposes only, and do not
  represent the legal or surveyed land parcel boundaries.\",\n\t\"license_title\":
